import "./filterBlocks.css";
import FilterLine from "./FilterLine";

function CheckBoxFilterBlock(props) {
  return (
    <div className="filterBlockContainer">
      {props.name}
      <div className="filterLinesContainer">
        {props.data.map((item) => (
          <FilterLine key={item.key} text={item.text} state={props.state} />
        ))}
      </div>
    </div>
  );
}

export default CheckBoxFilterBlock;
